import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './NewCategory.css'; // Import the CSS file

function NewCategory() {
  const [title, setTitle] = useState('');
  const [budget , setBudget] = useState('');
  const [color, setColor] = useState('');
  const [expense , setExpense] = useState('');
  console.log(title,budget,color,expense);
  function handleSubmit(event) {}
  return (
    <div class="new-category">
       <section className="newcat">
       <form onSubmit={handleSubmit}>
          <h1>Add New Categories</h1>
          {/* title--labels
budget--data
color--bgcolor
expense--expense
username
month--month */}
          <div className="input-box">
           <p>Title</p>
            <input type="text" placeholder='Enter Title' onChange={e => setTitle(e.target.value)} required />&nbsp;
          </div>
          <div className="input-box">
           <p>Total Budget</p>
            <input type="text" placeholder='Enter Total Budget' onChange={e => setBudget(e.target.value)} required />&nbsp;
          </div>
          <div className="input-box">
           <p>Color</p>
            <input type="text" placeholder='Enter Color' onChange={e => setColor(e.target.value)} required />&nbsp;
          </div>
          <div className="input-box">
           <p>Expense</p>
            <input type="text" placeholder='Enter Expense' onChange={e => setExpense(e.target.value)} required />&nbsp;
          </div>
         <button id="add" type="submit" className="btn">Add</button>
        </form>
      </section>
    </div>
  );
}

export default NewCategory;
